package proj1;

public class StringToSwapTwoNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a=10;
		int b=20;
		a=a+b;//10+20=30     a=30
		b=a-b;//30-20        b=10
		a=a-b;//30-10        a=20
		System.out.println(a);
		System.out.println(b);
		
		
	}

}
